import { Tabs, Tab, Toolbar, Typography,Box } from '@mui/material';
import AppBar from '@mui/material/AppBar';

export const Navbar = () => {



    return (
        <>
            <AppBar elevation={0}>
                <Toolbar disableGutters sx={{ p: 3, ml: 5 }} >
                <Box
        sx={{ display: 'flex', p: 1, bgcolor: 'background.paper', borderRadius: 1 }}
      >
        <Item sx={{ flexGrow: 1 }}>Item 1</Item>
        <Item>Item 2</Item>
        <Item>Item 3</Item>
      </Box>
                </Toolbar>

            </AppBar>
        </>
    )
}
